import './App.css';
import {BrowserRouter, Route} from "react-router-dom";
import TodoListApp from "./components/TodoListApp/TodoListApp";


function App() {
    return (
        <BrowserRouter>

            <div className="App">
                <h1>Projects</h1>
                <a href="/todoapp">fff</a>
            </div>
            <Route exact path={'/todoapp'} render={() => <TodoListApp/>}/>
        </BrowserRouter>

    );
}

export default App;
